(314, 1, '2016-05-21 07:15:59', '2016-05-21 07:15:59', 'Wartungsfreie Hochleistungsbatterie von JM-Technics mit GEL-Technologie. Der europäische Hersteller ist einer der führenden Anbieter für hochwertige Ersatzteile in der Automobil-und Zweiradbranche. Der Fokus liegt klar auf hochqualitativen Artikeln, welche die OEM Qualität des Originalherstellers entweder entsprechen oder gar übertreffen und das zu einem vernünftigen Preis.\r\n\r\nDie GEL-Technologie beruht auf der Zugabe von Kieselsäure und wandelt die in der Batterie notwendige Schwelfelsäure in ein Gel um. Das ermöglicht eine Montage in jeder Lage und die Batterie ist absolut auslaufsicher, selbst bei Beschädigung. Gel bietet durch die extrem geringe Selbstentladung eine der leistungsstärksten Startspannungen aller Batterietypen. Mehr High Tech passt in keine Batterie!', 'PORTRAX M200-B2', 'Wartungsfreie Hochleistungsbatterie von JM-Technics mit GEL-Technologie. Der europäische Hersteller ist einer der führenden Anbieter für hochwertige Ersatzteile in der Automobil-und Zweiradbranche. Der Fokus liegt klar auf hochqualitativen Artikeln, welche die OEM Qualität des Originalherstellers entweder entsprechen oder gar übertreffen und das zu einem vernünftigen Preis.', 'publish', 'open', 'closed', '', 'portrax-m200-b2', '', '', '2016-06-23 03:34:31', '2016-06-23 03:34:31', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=314', 0, 'product', '', 0),
