(316, 1, '2016-05-19 05:12:53', '2016-05-19 05:12:53', 'When the editors at Make: tested the original Ultimaker in our first annual Ultimate Guide to 3D Printing, we were impressed with the machine''s speed and resolution. When we tested the Ultimaker 2 in our 2nd Ultimate Guide, we were even more impressed.\n\nThe Ultimaker 2 was created to be as easy to use as possible, letting you focus on creating and enjoying your prints instead of spending time tweaking and troubleshooting the machine. The printer features a bright OLED (organic light-emitting diode) screen which allows you to print files directly from an SD card, freeing up your computer to do other things. The glass-heated print bed accommodates ABS plastic printing (in addition to PLA filament) and the redesigned hot-end was designed with a smaller hot zone to reduce potential clogs and jams.\n\nCapable of printing from 30-300mm/s and up to a .02mm (20 micron) layer height, the Ultimaker 2 is the fastest, highest resolution FDM (fused-deposition modeling) printer on the market today', 'Poetry infinity', '', 'inherit', 'closed', 'closed', '', '132-autosave-v1', '', '', '2016-05-19 05:12:53', '2016-05-19 05:12:53', '', 132, 'http://demo.cms-theme.net/wordpress/3dprinting/2016/05/19/132-autosave-v1/', 0, 'revision', '', 0),
(317, 1, '2016-05-21 07:09:20', '2016-05-21 07:09:20', '<h3 class="specs-title r-tablet-100">SERVICE AND SUPPORT</h3>\r\n<div class="specs-properties r-tablet-100">\r\n<div class="specs-row noinfo">\r\n\r\nWarranty\r\n<div class="specs-moreinfo">You’ll enjoy a comprehensive 12 month warranty (excl. hot end)</div>\r\n</div>\r\n<div class="specs-row noinfo">\r\n\r\nLifetime support\r\n<div class="specs-moreinfo">Expert technical support via email, phone, or from our global community is available to you for the lifetime of your printer.</div>\r\n</div>\r\n<div class="specs-row noinfo">\r\n\r\nExtended support\r\n<div class="specs-moreinfo">Online support pages, an easy to use app, extensive manuals, a detailed knowledgebase and so much more. You’re never far from the answers you ne</div>\r\n</div>\r\n</div>', 'ULTIMAKER 2', 'Based on the award-winning Ultimaker 2 and featuring all our latest innovations and understanding of 3D printing, the Ultimaker 2+ is one of the most advanced, accurate and reliable desktop 3D printers around.', 'publish', 'open', 'closed', '', 'ultimaker-2', '', '', '2016-06-23 03:39:12', '2016-06-23 03:39:12', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=317', 0, 'product', '', 0),
