(319, 1, '2016-05-21 07:05:05', '2016-05-21 07:05:05', 'Zortrax products are a complete package of integrated solutions – professional 3D printers, compatible materials and dedicated software. Thanks to this, our printers achieve high quality prints, dimensional accuracy and repeatability while eliminating the hassle of adjusting parameters of materials or software. The Zortrax Ecosystem is everything you need in one smart box.\r\n\r\nZortrax products are a complete package of integrated solutions – professional 3D printers, compatible materials and dedicated software. Thanks to this, our printers achieve high quality prints, dimensional accuracy and repeatability while eliminating the hassle of adjusting parameters of materials or software. The Zortrax Ecosystem is everything you need in one smart box.', 'PORTRAX M200-C1', 'Zortrax products are a complete package of integrated solutions – professional 3D printers, compatible materials and dedicated software. Thanks to this, our printers achieve high quality prints, dimensional accuracy and repeatability while eliminating the hassle of adjusting parameters of materials or software. The Zortrax Ecosystem is everything you need in one smart box.', 'publish', 'open', 'closed', '', 'portrax-m200-c1', '', '', '2016-06-23 03:39:49', '2016-06-23 03:39:49', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=319', 0, 'product', '', 0),
