(321, 1, '2016-05-21 07:08:19', '2016-05-21 07:08:19', 'The original RapMan 3D Printer was launched earlier this year, offering a revolutionary price / performance ratio within the 3D printing sector. The RapMan was, and still is, available for only £750 in kit form.\r\n\r\nThe RapMan Pro, however, builds on this offering with a pre-built version of the 3D Printer — with all of the benefits of the previous version with further refinements. The improvements include an anodized aluminum chassis, which provides greater rigidity and the Z axis now uses lead screws, which has enhanced Z-axis performance, accuracy and repeatability. The RapMan Pro will sell for just under £2,000 — still a fraction of the price of the competition, but giving away little in terms of performance or quality. Indeed, the RapMan Pro is faster than most 3D printers on the market and offers a wider choice of polymers than most of them too.\r\n\r\nDesigned by Bits From Bytes the RapMan Pro has been developed in line with a philosophy of open collaboration and is supplied by A1 Technologies — a company that fully believes in promoting advanced technologies for everyone.\r\n\r\nIt is really important to understand that the RapMan and the RapMan Pro offer seriously competitive advantages for any company or organization that is considering 3D Printing for product development and prototyping projects. The entry-level price should NOT be perceived as being indicative of inferior technologies or capabilities, as this is just not the case. The RapMan and RapMan Pro 3D Printers will be exhibited during the two-day TCT Live show, together with parts that have been built on the machine. Within this setting it will be easy for visitors to see for themselves just how the RapMan Pro compares with all of the other 3D printers on the market.', 'RAPMAN PRO', 'The RapMan Pro, however, builds on this offering with a pre-built version of the 3D Printer — with all of the benefits of the previous version with further refinements. The improvements include an anodized aluminum chassis, which provides greater rigidity and the Z axis now uses lead screws, which has enhanced Z-axis performance, accuracy and repeatability. The RapMan Pro will sell for just under £2,000 — still a fraction of the price of the competition, but giving away little in terms of performance or quality. Indeed, the RapMan Pro is faster than most 3D printers on the market and offers a wider choice of polymers than most of them too.', 'publish', 'open', 'closed', '', 'rapman-pro', '', '', '2016-06-23 03:39:24', '2016-06-23 03:39:24', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=321', 0, 'product', '', 0),
(322, 1, '2016-05-19 06:27:03', '2016-05-19 06:27:03', '', 'RAPMAN PRO', '', 'inherit', 'open', 'closed', '', 'rapman-pro', '', '', '2016-05-19 06:27:03', '2016-05-19 06:27:03', '', 321, 'http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/RAPMAN-PRO.jpg', 0, 'attachment', 'image/jpeg', 0),
(323, 1, '2016-05-21 07:17:30', '2016-05-21 07:17:30', 'With a massive build volume and the best price-to-performance ratio in the extra-large, professional 3D printer category, the MakerBot Replicator Z18 3D Printer solution is ideal for hands-on and technically adept users. The MakerBot Replicator Z18 seamlessly integrates with the growing MakerBot 3D Ecosystem of hardware, software, materials, and accessories.\r\n\r\nIt’s powered by the user-friendly, app- and cloud-enabled MakerBot OS, enabling you to remotely monitor your important 3D printing projects. Each printer is backed by a standard six-month warranty and includes a one-year MakerBot MakerCare Protection Plan that can be renewed for up to two additional years.\r\n\r\nThe MakerBot Replicator Z18 seamlessly integrates with the growing MakerBot 3D Ecosystem of hardware, software, materials, and accessories. It’s powered by the user-friendly, app- and cloud-enabled MakerBot OS, enabling you to remotely monitor your important 3D printing projects. Each printer is backed by a standard six-month warranty and includes a one-year MakerBot MakerCare Protection Plan that can be renewed for up to two additional years.', 'MAKER BOT Z18', 'With a massive build volume and the best price-to-performance ratio in the extra-large, professional 3D printer category, the MakerBot Replicator Z18 3D Printer solution is ideal for hands-on and technically adept users.', 'publish', 'open', 'closed', '', 'maker-bot-z18', '', '', '2016-06-23 03:34:22', '2016-06-23 03:34:22', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=323', 0, 'product', '', 0),
