(327, 1, '2016-05-21 07:35:11', '2016-05-21 07:35:11', 'We have pioneered the local use of stereolithography (SLA), in fact our operation can boast a room full of the country''s only commercially available SLA machines! We have recently expanded to include Selective Laser Sintering (SLS). Fine detail pieces we can also made using silicone and urethane molding. We offer Fused Deposition Modelling, the only additive manufacturing technology that produces production grade thermoplastics.\r\n\r\nFrom single components to runs of many, many thousands, all products meet precise technical tolerances: display models, electronic housings, mechanical components, packaging containers and bottles, casting patterns and more. We also have a specific focus in rapid prototyping.\r\n\r\nWe have expertise and commercial knowledge, a commitment to customer service, and can''t wait to work with you.', 'PRECISION', 'We have pioneered the local use of stereolithography (SLA), in fact our operation can boast a room full of the country''s only commercially available SLA machines! We have recently expanded to include Selective Laser Sintering (SLS). Fine detail pieces we can also made using silicone and urethane molding. We offer Fused Deposition Modelling, the only additive manufacturing technology that produces production grade thermoplastics.', 'publish', 'open', 'closed', '', 'precision', '', '', '2016-06-23 03:33:46', '2016-06-23 03:33:46', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=327', 0, 'product', '', 0),
