(329, 1, '2016-05-21 07:02:24', '2016-05-21 07:02:24', 'World class specs. Unmatched with its max print speed of 300mm/s and 20 micron layer resolution\r\nIndustry-leading print-to-size ratio. Small footprint, large build volume.\r\nPremium materials used in construction. Heated bed smooths prints and allows for ABS printing.', 'ULTIMAKER 2 EXTENDED', 'World class specs. Unmatched with its max print speed of 300mm/s and 20 micron layer resolution\r\nIndustry-leading print-to-size ratio. Small footprint, large build volume.\r\nPremium materials used in construction. Heated bed smooths prints and allows for ABS printing.\r\n<div class="specs-properties r-tablet-100">\r\n<div class="specs-row noinfo">\r\n\r\nWarranty\r\n<div class="specs-moreinfo">You’ll enjoy a comprehensive 12 month warranty (excl. hot end)</div>\r\n</div>\r\n<div class="specs-row noinfo">\r\n\r\nLifetime support\r\n<div class="specs-moreinfo">Expert technical support via email, phone, or from our global community is available to you for the lifetime of your printer.</div>\r\n</div>\r\n<div class="specs-row noinfo">\r\n\r\nExtended support\r\n\r\n</div>\r\n</div>', 'publish', 'open', 'closed', '', 'ultimaker-2-extended', '', '', '2016-06-23 03:41:01', '2016-06-23 03:41:01', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=329', 0, 'product', '', 0),
