(331, 1, '2016-05-21 07:06:58', '2016-05-21 07:06:58', '<div id="product_description" class="col-1-1 alpha omega with-border" data-section="product-overview">\r\n<div class="section">\r\n<div id="product-description-traditional">\r\n<div class="main_description alpha omega col-6-10">\r\n<p class="normal">The educational and useful MakerBot Replicator Mini Compact 3D Printer provides easy, affordable and portable 3D printing. Transform a small desk in your home or classroom into an exciting learning center. Educate students how to think, imagine, create, and print in 3D, while preparing them for the jobs of the future. Create opportunities for children to bond with parents, siblings, classmates, and teachers. Choose from over 465,000 free, predesigned, and ready-to-print educational, entertaining, and useful 3D models on MakerBot Thingiverse. Itâ€™s portable, so take it where you need it.</p>\r\n\r\n<ul class="bulletList">\r\n 	<li>Easy, affordable and portable 3D printing</li>\r\n 	<li>Enjoy simple convenience with everything you need to get started</li>\r\n 	<li>Start printing right away with virtually no learning curve</li>\r\n 	<li>Transforms a small desk in your home or classroom into an exciting learning center</li>\r\n 	<li>Educate students how to think, imagine, create, craft and print in 3D, while preparing them for the jobs of the future</li>\r\n 	<li>Create opportunities for students to bond with parents, siblings, classmates, and teachers</li>\r\n 	<li>Fifth Generation technology defines the new standard for ease of use</li>\r\n 	<li>Create and print models directly from your tablet or smartphone using MakerBot PrintShop</li>\r\n 	<li>Portable â€“ take it where you need it</li>\r\n 	<li>Access the MakerBot 3D Ecosystem, a growing, synergetic ecosystem of products, materials, software, accessories, services, and content that integrate seamlessly with each other to provide a satisfying MakerBot experience</li>\r\n</ul>\r\n</div>\r\n<div id="moreinfo_wrapper" class="col-4-10 alpha omega" data-component="info-and-guides">\r\n<div id="more-info">\r\n<h3 class="page-title">Info &amp; Guides</h3>\r\n<ul>\r\n 	<li><span class="btn-icon"><i class="icon-view-pdf"></i>Installation Guide</span></li>\r\n</ul>\r\n<p class="download_message">You will need Adobe® Acrobat® Reader to view PDF documents.  Download a free copy from the Adobe Web sit</p>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id="irgContainer" class="col-1-1 alpha omega with-border"></div>', 'MAKER BOT MINI', 'The educational and useful MakerBot Replicator Mini Compact 3D Printer provides easy, affordable and portable 3D printing. Transform a small desk in your home or classroom into an exciting learning center. Educate students how to think, imagine, create, and print in 3D, while preparing them for the jobs of the future. Create opportunities for children to bond with parents, siblings, classmates, and teachers. Choose from over 465,000 free, predesigned, and ready-to-print educational, entertaining, and useful 3D models on MakerBot Thingiverse. Itâ€™s portable, so take it where you need it.', 'publish', 'open', 'closed', '', 'maker-bot-mini', '', '', '2016-06-23 03:39:37', '2016-06-23 03:39:37', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=331', 0, 'product', '', 0),
