(333, 1, '2016-05-21 07:10:23', '2016-05-21 07:10:23', 'The 3D Printer Superstore is proud to announce the global release of the Flashforge Creator Pro 2016 edition. Officially released on the 16th April 2016, This latest design is more compact and refined with structural improvements to the chassis- utilising pressed aluminum, increasing rigidity and ultimately improving print quality. Enhanced ergonomics, calibration nobles, LED display and keypad.\r\n\r\nThe incorporation of injection molded and panels, door and hood, improving the effectiveness of the heat retention chamber which will reduce warpage of ABS 3d printed parts. This sleek machine certainly looks the part and is a serious performer. You can now use the powerful and user friendly Flashforge Flashprint 3d slicing software with this machine.', '3D MAKER PRO 230', 'The 3D Printer Superstore is proud to announce the global release of the Flashforge Creator Pro 2016 edition. Officially released on the 16th April 2016, This latest design is more compact and refined with structural improvements to the chassis- utilising pressed aluminum, increasing rigidity and ultimately improving print quality.', 'publish', 'open', 'closed', '', '3d-maker-pro-230', '', '', '2016-06-23 03:38:59', '2016-06-23 03:38:59', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=333', 0, 'product', '', 0),
