(335, 1, '2016-05-19 07:02:52', '2016-05-19 07:02:52', 'British new rave band Klaxons kicked off their long-awaited 3D printed tour last weekend in Norwich. This year’s June, they already made a statement about this 3D printed tour, and now the 3D printed instruments are ready to rock. The University of Sheffield’s news department, however, reports that they solely got their guitars printed, and not the other instruments.', 'Klaxons’s 3D Printed Tour Kicks Off, But It Could Be Their Last', '', 'publish', 'open', 'open', '', 'klaxonss-3d-printed-tour-kicks-off-but-it-could-be-their-last', '', '', '2016-05-20 08:37:39', '2016-05-20 08:37:39', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=335', 0, 'post', '', 0),
(338, 1, '2016-05-21 04:00:57', '2016-05-21 04:00:57', 'iOS 9 brings you refinements at every level — from the apps you see on your Home screen down to the foundation of the system. Siri is smarter than ever, proactive suggestions keep you on track, and multitasking on iPad hits an all-new high with Slide Over, Split View, and Picture in Picture. All these enhancements enable your devices — and you — to do so much more every day.\r\n<p class="copy">iOS is the world’s most advanced mobile operating system, and it’s the foundation of iPhone, iPad, and iPod touch. It comes with a collection of apps and features that let you do the everyday things, and the not-so-everyday things, in ways that are intuitive, simple, and fun.</p>', 'IPHONE 4S DAAA', 'When the editors at Make: tested the original Ultimaker in our first annual Ultimate Guide to 3D Printing, we were impressed with the machine’s speed and resolution. When we tested the Ultimaker 2 in our 2nd Ultimate Guide, we were even more impressed.\r\n\r\n&nbsp;', 'publish', 'open', 'closed', '', 'iphone-4s-daaa', '', '', '2016-05-23 02:01:26', '2016-05-23 02:01:26', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=338', 0, 'product', '', 0),
(340, 1, '2016-05-21 03:52:06', '2016-05-21 03:52:06', '<span class="a-list-item">Magnification, it make each mobile phone has large screen clear movies like Reduce eye fatigue of movies and television brought on mobile phone, and stinging eyes and tears phenomenon.</span><span class="a-list-item">Mobile phone adapter use skid material, prevent slip, fall. Folding design, small volume, convenient carrying on business travel.</span><span class="a-list-item">Compatible with iPhone 3, iPhone 4, iPhone 5, Samsung phone, HTC phone, LG, Nokia phone, Blackberry phone, Sony phone, phone, ZTE phone, Motorola phone, Google phone and other brands of mobile phone. How to use it: Please avoid using in direct sunlight or strong light, avoid light cause is not clear, it will display better in the dark light environment.</span><span class="a-list-item">This is the New Mobile Phone Screen Magnifier Bracket and Enlarge Stand, which can 3x~5x magnify your phone screen so as to reduce your eyes'' fatigue during watching videos on the phone.</span>', 'MOBILE STAND', '<span class="a-list-item"> Folding design, small volume, convenient carrying on business travel.</span><span class="a-list-item">Compatible with iPhone 3, iPhone 4, iPhone 5, Samsung phone, HTC phone, LG, Nokia phone, Blackberry phone, Sony phone, phone, ZTE phone, Motorola phone, Google phone and other brands of mobile phone</span>', 'publish', 'open', 'closed', '', 'mobile-stand', '', '', '2016-05-23 02:04:48', '2016-05-23 02:04:48', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=340', 0, 'product', '', 0),
(342, 1, '2016-05-21 03:47:59', '2016-05-21 03:47:59', 'Una de las prendas más sexys y elegantes de nuestra tienda Lily Blossom son los ligueros. Se trata de un invento de los años 20, del siglo pasado, y desde entonces se considera esta pieza de lencería femenina como el culmen del erotismo y la sensualidad femenina.  Se utilizan para sujetar las medias y también se suelen poner cuando llevamos un corsé. El liguero lo sostenemos a la cintura y suelen llevar cuatro ligas, dos para la parte delantera y dos en la trasera. En Lily Blossom tenemos la venta online de los ligueros más sexys y sensuales. Nuestra tienda en Madrid, en Claudio Coello , te sorprenderá por la gran variedad de diseñadores y marcas que podremos mostrarte.', 'LILY BLOSSOM', 'Una de las prendas más sexys y elegantes de nuestra tienda Lily Blossom son los ligueros. Se trata de un invento de los años 20, del siglo pasado, y desde entonces se considera esta pieza de lencería femenina como el culmen del erotismo y la sensualidad femenina.  Se utilizan para sujetar las medias y también se suelen poner cuando llevamos un corsé. El liguero lo sostenemos a la cintura y suelen llevar cuatro ligas, dos para la parte delantera y dos en la trasera. En Lily Blossom tenemos la venta online de los ligueros más sexys y sensuales. Nuestra tienda en Madrid, en Claudio Coello , te sorprenderá por la gran variedad de diseñadores y marcas que podremos mostrarte.', 'publish', 'open', 'closed', '', 'lily-blossom', '', '', '2016-05-23 02:03:14', '2016-05-23 02:03:14', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=342', 0, 'product', '', 0),
(344, 1, '2016-05-21 03:26:45', '2016-05-21 03:26:45', 'Real butterfly wings are used after their natural passing and turned into wearable art! Nothing is done to harm the butterfly. Butterflies are acquired from preservation farms worldwide and information cards will be included to learn more.\r\n\r\nThese wings come from the Papilio Bromius butterfly and measure approximately 1.5"x2" (not including the earring hook). The wings can be finished in a thick lamination (similar to the thickness of cardstock paper) or in jeweler''s grade resin. The resin finish is considered higher quality and is approximately 1/8" thick with a glossier look. Both options are durable, lightweight, and waterproof. Due to working with natural supplies each product may slightly vary than what is pictured. Finished wings are attached to hypoallergenic surgical steel earring hooks and two earring backs are included. Other earring hook options are available upon request.', 'BUTTERFLY EARRINGS', 'Sterling Silver 11x7mm Oval Green Turquoise Stud Earrings', 'publish', 'open', 'closed', '', 'butterfly-earrings', '', '', '2016-06-23 04:07:46', '2016-06-23 04:07:46', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=344', 0, 'product', '', 0),
(351, 1, '2016-05-21 03:45:52', '2016-05-21 03:45:52', '3D printing users consider the technology to create plastic parts as its the most common kind of SLS 3D printing. In the case of plastic SLS 3D printing (as the one we do at Sculpteo), the raw material is polyamide (PA12), but you can find other kind of powders with properties that are different from polyamide. Alumide is in fact a combination of polyamide and aluminium. The aluminium is what gives the metallic appearance to the part and its strengh.\r\n\r\nIn other words, it bridges the quality of both polyamide and aluminium in a 3D print. Parts created in Alumide enjoys a good machinability, high temperature performances, a well-balanced ratio of density and stiffness  with a good dimensional accuracy.', 'RIBBLE RING ALUMIDE', 'This model is 3D Printed in Rhodium Plated: Polished brass plated with Rhodium', 'publish', 'open', 'closed', '', 'ribble-ring-alumide', '', '', '2016-05-23 02:21:20', '2016-05-23 02:21:20', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=351', 0, 'product', '', 0),
(357, 1, '2016-05-19 07:21:57', '2016-05-19 07:21:57', 'Festo is an industry leader in advanced robotics and they have presented two of their projects: BionicANTs and eMotionButterfiles only made possible by using laser sintering 3D printing and 3D MID ( Molded Interconnect Device) technology. 3D MID is a control and power system where electrical circuits are attached on the surface of the laser', 'Festo 3D Prints Robotic Ants and Butterflies', '', 'publish', 'open', 'open', '', 'festo-3d-prints-robotic-ants-and-butterflies', '', '', '2016-05-20 08:37:37', '2016-05-20 08:37:37', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=357', 0, 'post', '', 0),
(361, 1, '2016-05-19 07:27:30', '2016-05-19 07:27:30', 'You’re looking at the world’s first 3D printed supercar, Blade. That’s right, the beautiful car in the photo above has a chassis that’s made up entirely of 3D printed aluminum nodes and carbon fiber connectors. The term supercar is no gimmick either. Weighing a mere 1,388lbs, this beast pumps out a whopping 700hp and 500lb-ft', 'Faster Than a Ferrari and It Was 3D Printed?', '', 'publish', 'open', 'open', '', 'faster-than-a-ferrari-and-it-was-3d-printed', '', '', '2016-05-20 08:37:34', '2016-05-20 08:37:34', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=361', 0, 'post', '', 0),
