(378, 1, '2016-05-19 07:39:09', '2016-05-19 07:39:09', '3D printing has already ushered in a new era of low-cost prosthetics. In addition to yielding custom limbs that are orders of magnitude less expensive than their traditionally manufactured counterparts, 3D printing is giving prostheses wearers the ability to express their identities like never before (see yesterday’s post on Alex Pring’s Iron Man-themed arm).', '3D PRINTED PROSTHETIC FROM OPEN BIONICS', '', 'publish', 'open', 'open', '', '3d-printed-prosthetic-from-open-bionics', '', '', '2016-05-20 08:37:32', '2016-05-20 08:37:32', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=378', 0, 'post', '', 0),
(380, 1, '2016-05-19 07:40:33', '2016-05-19 07:40:33', 'Through a partnership between Dubai and Winsun Global, a Chinese 3D printing technology company, Dubai is set to build the world’s first 3D-printed office building. Winsun Global will print the office layer by layer using a 3d printer that measures 20 ft in height, the same 3d printer which they used to 3D print.\r\n\r\nThrough a partnership between Dubai and Winsun Global, a Chinese 3D printing technology company, Dubai is set to build the world’s first 3D-printed office building. Winsun Global will print the office layer by layer using a 3d printer that measures 20 ft in height, the same 3d printer which they used to 3D print\r\n\r\nThrough a partnership between Dubai and Winsun Global, a Chinese 3D printing technology company, Dubai is set to build the world’s first 3D-printed office building. Winsun Global will print the office layer by layer using a 3d printer that measures 20 ft in height, the same 3d printer which they used to 3D print', 'Dubai to Construct the World’s First 3D Printed Office Building', '', 'publish', 'open', 'open', '', 'dubai-to-construct-the-worlds-first-3d-printed-office-building', '', '', '2016-05-30 09:56:03', '2016-05-30 09:56:03', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=380', 0, 'post', '', 0),
(384, 1, '2016-05-21 04:45:53', '2016-05-21 04:45:53', 'Capture your world in 3D and discover the power of physical photography with the Sense 3D scanner. Savor every dimension of your favorite memories: Graduation day. Wedding day. Bringing home baby. Holidays. Trips around the world. All with your Sense, all in 3D.', 'SENSE™', 'Capture your world in 3D and discover the power of physical photography with the Sense 3D scanner.', 'publish', 'open', 'closed', '', 'sense', '', '', '2016-05-21 06:39:57', '2016-05-21 06:39:57', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=384', 0, 'product', '', 0),
