(390, 1, '2016-05-21 04:48:48', '2016-05-21 04:48:48', '<ul>\r\n 	<li>The SCANIFY Mobile Package makes 3D scanning on the move a reality, removing the need for a desktop or laptop as well as an electricity source to connect the scanner.\r\nTo complete the SCANIFY Mobile Package, you will need the following three things:</li>\r\n 	<li>A set of SCANIFY specific cables which can be ordered through this product page</li>\r\n 	<li>A portable battery pack which consistently outputs 5V 2A. We’ve tested and would recommend you purchase the 5600 mAH AmazonBasics portable battery pack</li>\r\n 	<li>A tablet PC suitable to run Fuel3D Studio and a 3D printed tablet mount to house all the components: click here to see an example of a tablet mount suitable for the above battery pack and the Dell Venue 8 Pro Tablet</li>\r\n</ul>', 'SCANIFY', 'The SCANIFY Mobile Package makes 3D scanning on the move a reality, removing the need for a desktop or laptop as well as an electricity source to connect the scanner.', 'publish', 'open', 'closed', '', 'scanify-mobile', '', '', '2016-06-23 04:02:11', '2016-06-23 04:02:11', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=390', 0, 'product', '', 0),
