(479, 1, '2016-05-21 04:05:47', '2016-05-21 04:05:47', 'When you need a pair of skate shoes that help you do the latest tricks, check out the Atwood sneakers by Vans.\r\n\r\nFrom a sporting sense our catalogue contains women''s trainers, running shoes, tennis shoes and everything else you would associate with the sport of your choice, all by the biggest brands such as Nike, adidas, Puma, Reebok and Karrimor. We also stock casual and smart options in the form of women''s boots, sandals, hi tops and shoes with all available at exceptionally low prices.\r\n<ul>\r\n 	<li>Canvas upper in an athletic skate shoe style</li>\r\n 	<li>Lace-up front, metal eyelets</li>\r\n 	<li>Padded collar</li>\r\n 	<li>Textile lining, padded insole</li>\r\n 	<li>Grippy rubber outsole</li>\r\n</ul>', 'FOOTWEAR', 'Canvas upper in an athletic skate shoe style', 'publish', 'open', 'closed', '', 'footwear', '', '', '2016-05-23 01:57:06', '2016-05-23 01:57:06', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=479', 0, 'product', '', 0),
(481, 1, '2016-05-20 10:22:12', '2016-05-20 10:22:12', 'Inspired by the geometry of an artichoke, this beautiful lamp shade is perfect for the home or business. You can use any standard hanging light cord and a low temp bulb (such as a cfl bulb.) We purchased a standard lamp base with a 12 ft cord from amazon and…', 'Dubai to Construct the World’s', '', 'publish', 'open', 'closed', '', 'dubai-to-construct-the-worlds', '', '', '2016-05-20 10:31:58', '2016-05-20 10:31:58', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=portfolio&#038;p=481', 0, 'portfolio', '', 0),
