(483, 1, '2016-05-20 10:23:20', '2016-05-20 10:23:20', 'Two researchers from the University of Cape Town have developed an award-winning and affordable 3D printed mechanical hand with individual finger control.\r\n\r\nDr. George Vicatos, the Popular Mechanics’ South African Inventor of the year worked side by side with his MSc student, Severin Tenim to design and develop a low-cost mechanical hand, which was presented and awarded at the Popular Mechanics Future Tech event in Cape Town.\r\n<blockquote>Dr. George Vicatos commented, I wanted to address amputees in the low-income bracket; to create a hand that doesn’t cost a fortune, but that works similarly to a real hand. Because the alternative for this income group is a hook, or a non–functional hand.</blockquote>\r\nThe mechanical hand’s individual finger control was specifically designed for right or left upper limb amputees, to allow patients to control their fingers by using a metal cord and a release functionality.\r\n\r\nThe cords are placed at the back in a harness, as the movements of the shoulder controls the release function. Through such unique control system, individual fingers can move independently. Dr Vicatos stated, “There is no other mechanically operated device that is as close to the anatomical function of the hand as this,” said Dr. Vicatos.\r\n\r\nComponents for the mechanical hand were 3d printed in the University of Capetown and were assembled by Vicatos and his student, Tenim.', 'Mechanical Hand with Individual', '', 'publish', 'open', 'closed', '', 'mechanical-hand-with-individual', '', '', '2016-07-26 03:32:53', '2016-07-26 03:32:53', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=portfolio&#038;p=483', 0, 'portfolio', '', 0),
