(496, 1, '2016-05-21 02:05:38', '2016-05-21 02:05:38', 'Moisture laden ABS will tend to bubble and spurt from the tip of the nozzle when printing; reducing the visual quality of the part, part accuracy, strength and introducing the risk of a stripping or clogging in the nozzle. ABS can be easily dried using a source of hot (preferably dry) air such as a food dehydrator.\r\n\r\nFor most, the single greatest hurdle for accurate parts in ABS will be a curling upwards of the surface in direct contact with the 3D Printer''s print bed. A combination of heating the print surface and ensuring it is smooth, flat and clean goes a long way in eliminating this issue. Additionally, some find various solutions can be useful when applied beforehand to the print surface. For example, a mixture of ABS/Acetone, or a shot of hairspray.\r\n\r\nFor fine features on parts involving sharp corners, such as gears, there will often be a slight rounding of the corner. A fan to provide a small amount of active cooling around the nozzle can improve corners but one does also run the risk of introducing too much cooling and reducing adhesion between layers, eventually leading to cracks in the finished part.', 'ABS-FILAMENT', 'Moisture laden ABS will tend to bubble and spurt from the tip of the nozzle when printing; reducing the visual quality of the part, part accuracy, strength and introducing the risk of a stripping or clogging in the nozzle. ABS can be easily dried using a source of hot (preferably dry) air such as a food dehydrator.', 'publish', 'open', 'closed', '', 'abs-filament', '', '', '2016-06-23 04:04:49', '2016-06-23 04:04:49', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=496', 0, 'product', '', 0),
(498, 1, '2016-05-21 02:08:12', '2016-05-21 02:08:12', 'Compared to ABS, PLA demonstrates much less part warping. For this reason it is possible to successfully print without a heated bed and use more commonly available "Blue" painters tape as a print surface. Ironically, totally removing the heated bed can still allow the plastic to curl up slightly on large parts, though not always.\r\n\r\nPLA undergoes more of a phase-change when heated and becomes much more liquid. If actively cooled, much sharper details can be seen on printed corners without the risk of cracking or warp. The increased flow can also lead to stronger binding between layers, improving the strength of the printed part.\r\n\r\nCreated from processing any number of plant products including corn, potatoes or sugar-beets, PLA is considered a more ''earth friendly'' plastic compared to petroleum based ABS. Used primarily in food packaging and containers, PLA can be composted at commercial compost facilities. It won''t bio-degrade in your backyard or home compost pile however. It is naturally transparent and can be colored to various degrees of translucency and opacity. Also strong, and more rigid than ABS, it is occasionally more difficult to work with in complicated interlocking assemblies and pin-joints. Printed objects will generally have a glossier look and feel than ABS. With a little more work, PLA can also be sanded and machined. The lower melting temperature of PLA makes it unsuitable for many applications as even parts spending the day in a hot car can droop and deform.', 'FDM-FILAMENT', 'PLA undergoes more of a phase-change when heated and becomes much more liquid. If actively cooled, much sharper details can be seen on printed corners without the risk of cracking or warp. The increased flow can also lead to stronger binding between layers, improving the strength of the printed part.', 'publish', 'open', 'closed', '', 'fdm-filament', '', '', '2016-06-23 04:10:26', '2016-06-23 04:10:26', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=498', 0, 'product', '', 0),
