(503, 1, '2016-05-21 02:12:36', '2016-05-21 02:12:36', 'PolyMakr''s PolyPlus series is engineered for quality so superior that it has given them the bragging rights as the creators of the most stable PLA on the market. Not only is PolyPlus PLA nice and sturdy, but it also has the stamp of approval from the FD\r\n<div>PolyMakr prides themselves on the fact that their PolyPlus not only looks fantastic, but also has solid properties you can''t refuse. This intricate formula provides tighter specifications that won''t jam your extruder and will lead to more reliable prints that won''t let you down. Not to mention, all ingredients used to formulate PolyPlus are indeed FDA approved!</div>\r\n<div>\r\n\r\nWe highly recommend storing unused PolyPlus PLA filament in a resealable bag with a desiccant pack to prevent moisture absorption.\r\n\r\n<strong>Technical Specifications</strong>\r\n<div>\r\n\r\nAverage filament diameter: 1.75 mm\r\n\r\nStandard deviation of diameter: &lt; 0.05 mm (~ 0.02 mm typical)\r\n\r\nRecommended printing temperatures: 190 - 210 °C (with heated bed) / 210 - 230 °C (without heated bed)\r\n\r\nRecommended heated bed temperature: 60 - 70 °C\r\n\r\nPrinting speed: 40 - 120 mm/s\r\n\r\n</div>\r\n</div>', 'POLYPLUS-GRANDE', 'PolyMakr prides themselves on the fact that their PolyPlus not only looks fantastic, but also has solid properties you can''t refuse. This intricate formula provides tighter specifications that won''t jam your extruder and will lead to more reliable prints that won''t let you down. Not to mention, all ingredients used to formulate PolyPlus are indeed FDA approved!', 'publish', 'open', 'closed', '', 'polyplus-grande', '', '', '2016-05-23 03:39:14', '2016-05-23 03:39:14', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=503', 0, 'product', '', 0),
