(505, 1, '2016-05-21 02:13:41', '2016-05-21 02:13:41', 'The PolyPlus from Polymakr is a PLA (Acid Poly Lactic acid) of very high quality.\r\n\r\nThe first step of the manufacturing process consists of the extraction of vegetable starch, a renewable material, ensuring that a product is eco-responsible.\r\nThis starch will then be polymerized to obtain PLA high purity, which ensures the reliability of your impressions, and also allows for future recycling\r\n\r\nOur filament, Polymakr it been tested on all type of 3D printers including :\r\n•MakerBot Replicator (original, 2, 2X,...)\r\n•Ultimaker (original and derived)\r\n•dagoma discovery\r\n•PP3DP Up! (series 2 and mini)\r\n•RepRap\r\n•MakerGear M2\r\n\r\nNote : The filament, Polymakr are packaged under vacuum to ensure their longevity.', 'POLYPLUS-ORANGE', 'The PolyPlus from Polymakr is a PLA (Acid Poly Lactic acid) of very high quality.\r\nThe first step of the manufacturing process consists of the extraction of vegetable starch, a renewable material, ensuring that a product is eco-responsible.\r\nThis starch will then be polymerized to obtain PLA high purity, which ensures the reliability of your impressions, and also allows for future recycling.\r\nWe add, finally, the notes of pigment that gives PolyPlus its vast array of colours !\r\nIn order to guarantee the quality of our material for your impressions, our unique manufacturing process and our chemical formula is patented.', 'publish', 'open', 'closed', '', 'polyplus-orange', '', '', '2016-05-23 03:40:06', '2016-05-23 03:40:06', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=505', 0, 'product', '', 0),
