(518, 1, '2016-05-21 03:09:54', '2016-05-21 03:09:54', 'it''s beautiful, filled with impressive architecture, history and culture, but what I enjoy the most in Paris is the enthusiasm most citizen share for good food, music and "happy hours" in their favorite cafe. What happened last Friday, only a few meters from the bar I chose to celebrate the weekend with my friends, can''t be described. My way to fight these barbarian is to keep celebrating what they hate. History, liberty, art and love of beauty on earth.\r\n\r\nThis Lamp inspired by Gustave Eiffel''s most famous construction is a reminder that the city of light will always be the symbol of all these things, no matter what they do to it.', 'PARIS LAMP', 'This Lamp inspired by Gustave Eiffel''s most famous construction is a reminder that the city of light will always be the symbol of all these things, no matter what they do to it.', 'publish', 'open', 'closed', '', 'paris-lamp', '', '', '2016-05-23 02:06:14', '2016-05-23 02:06:14', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=518', 0, 'product', '', 0),
(520, 1, '2016-05-21 03:24:41', '2016-05-21 03:24:41', 'Along with water and sunshine, the proper kind of soil will make a big difference in the quality of your flowers and vegetables. Getting the dirt on the kind of dirt you have and amending it will put you on the right track for gardening success.\r\n\r\nKnow your soil. It’s the rare gardener who is fortunate enough to begin with ideal soil — that loamy, friable dirt that holds together when you squeeze a handful. A sandy soil will fail to hold its shape when squeezed, and slightly damp clay soil clumps when squeezed\r\n\r\nA soil’s pH determines what plants will thrive in it. You can use a soil test kit or one from your local Cooperative Extension Service. Acidic soil can be amended with lime to make it more neutral or alkaline, while garden sulfur is added to alkaline soils to make them more acidic..', 'CUBITE-PLANTER', 'Getting the dirt on the kind of dirt you have and amending it will put you on the right track for gardening success.', 'publish', 'open', 'closed', '', 'cubite-planter', '', '', '2016-06-23 04:09:41', '2016-06-23 04:09:41', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=520', 0, 'product', '', 0),
