(523, 1, '2016-05-21 03:41:15', '2016-05-21 03:41:15', '<b>Rubik''s Cube</b> is a 3-D combination puzzle invented in 1974by Hungarian sculptor and professor of architecture Ernő Rubik. Originally called the <b>Magic Cube</b>, the puzzle was licensed by Rubik to be sold by Ideal Toy Corp. in 1980 via businessman Tibor Laczi and Seven Towns founder Tom Kremer,and won the German Game of the Year special award for Best Puzzle that year. As of January 2009, 350 million cubes had been sold worldwide making it the world''s top-selling puzzle game.<span style="font-size: 13.3333px; line-height: 20px;">I</span>t is widely considered to be the world''s best-selling toy.<sup id="cite_ref-10" class="reference"></sup>In a classic Rubik''s Cube, each of the six faces is covered by nine stickers, each of one of six solid colours: white, red, blue, orange, green, and yellow. In currently sold models, white is opposite yellow, blue is opposite green, and orange is opposite red, and the red, white and blue are arranged in that order in a clockwise arrangement.<span style="font-size: 13.3333px; line-height: 20px;"> </span>On early cubes, the position of the colours varied from cube to cube.<span style="font-size: 13.3333px; line-height: 20px;"> </span>An internal pivot mechanism enables each face to turn independently, thus mixing up the colours. For the puzzle to be solved, each face must be returned to have only one colour. Similar puzzles have now been produced with various numbers of sides, dimensions, and stickers, not all of them by Rubik.', 'RUBIK’S CUBE', '<b>Rubik''s Cube</b> is a 3-D combination puzzle invented in 1974by Hungarian sculptor and professor of architecture Ernő Rubik. Originally called the <b>Magic Cube</b>, the puzzle was licensed by Rubik to be sold by Ideal Toy Corp. in 1980 via businessman Tibor Laczi and Seven Towns founder Tom Kremer,and won the German Game of the Year special award for Best Puzzle that year. As of January 2009, 350 million cubes had been sold worldwide making it the world''s top-selling puzzle game.<span style="font-size: 13.3333px; line-height: 20px;">I</span>t is widely considered to be the world''s best-selling toy.<sup id="cite_ref-10" class="reference"></sup>In a classic Rubik''s Cube, each of the six faces is covered by nine stickers, each of one of six solid colours: white, red, blue, orange, green, and yellow. In currently sold models, white is opposite yellow, blue is opposite green, and orange is opposite red, and the red, white and blue are arranged in that order in a clockwise arrangement. On early cubes, the position of the colours varied from cube to cube. An internal pivot mechanism enables each face to turn independently, thus mixing up the colours. For the puzzle to be solved, each face must be returned to have only one colour. Similar puzzles have now been produced with various numbers of sides, dimensions, and stickers, not all of them by Rubik.', 'publish', 'open', 'closed', '', 'rubiks-cube', '', '', '2016-05-23 02:24:44', '2016-05-23 02:24:44', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=523', 0, 'product', '', 0),
