(526, 1, '2016-05-21 04:10:08', '2016-05-21 04:10:08', 'Len je potrebné vedieť, kedy a ako ich trhať a sušiť a akým spôsobom ich pripravovať.\r\n<div class="articlebox flower">Vzhľadom na vysoký obsah minerálnych látok, ako sú vápnik, železo, fosfor a horčík, dokážu žihľavy dodávať nášmu organizmu hlavne dostatočné množstvo vitamínu C. Najvyšší podiel týchto látok majú na jar, kedy môžeme zbierať celé mladé výhonky. Pozor ale na miesta, kde rastú až príliš bujne, to by mohli v sebe hromadiť vysoké množstvo dusičnanov. Tam ich radšej nezbierame. Ak chceme odbúrať pálčivú chuť žihľavy, sparíme ju horúcou vodou s teplotou cca 80 ° C.</div>', 'DOBRE NAPADY', 'Len je potrebné vedieť, kedy a ako ich trhať a sušiť a akým spôsobom ich pripravovať.', 'publish', 'open', 'closed', '', 'dobre-napady', '', '', '2016-05-23 01:53:06', '2016-05-23 01:53:06', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=526', 0, 'product', '', 0),
