(528, 1, '2016-05-21 04:11:47', '2016-05-21 04:11:47', 'Along with water and sunshine, the proper kind of soil will make a big difference in the quality of your flowers and vegetables. Getting the dirt on the kind of dirt you have and amending it will put you on the right track for gardening success.\r\n\r\nKnow your soil. It’s the rare gardener who is fortunate enough to begin with ideal soil — that loamy, friable dirt that holds together when you squeeze a handful. A sandy soil will fail to hold its shape when squeezed, and slightly damp clay soil clumps when squeezed\r\n\r\nA soil’s pH determines what plants will thrive in it. You can use a soil test kit or one from your local Cooperative Extension Service. Acidic soil can be amended with lime to make it more neutral or alkaline, while garden sulfur is added to alkaline soils to make them more acidic..', 'COBALT BLUE', 'Getting the dirt on the kind of dirt you have and amending it will put you on the right track for gardening success.', 'publish', 'open', 'closed', '', 'cobalt-blue', '', '', '2016-06-23 04:09:18', '2016-06-23 04:09:18', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=528', 0, 'product', '', 0),
