(533, 1, '2016-05-21 04:26:58', '2016-05-21 04:26:58', 'Tinkerplay is based on the Modio app which Autodesk acquired last year. The app allowed for simple, intuitive and entertaining construction of models which were almost immediately available for 3D printing without the need for additional rafts or support material.Autodesk has since added new features, functionality and parts to the application, and has today announced the release of it under the Tinkercad family of products.\r\n\r\nUsers also have the opportunity to play around with their 3D creation on their smartphone or tablet, by placing them in various scenes and backgrounds at varying times of the day and in numerous positions.\r\n\r\nThe Tinkerplay application is available on both mobile and desktop devices, using any of the following operating systems: iOS, Android, Windows and Windows phones. It is available for download immediately at Google Play, the App Store, and the Windows Store. Let us know if you have downloaded and tested this exciting 3D modeling application out.', 'THINK MAKER', 'Tinkerplay is based on the Modio app which Autodesk acquired last year. The app allowed for simple, intuitive and entertaining construction of models which were almost immediately available for 3D printing without the need for additional rafts or support material.Autodesk has since added new features, functionality and parts to the application, and has today announced', 'publish', 'open', 'closed', '', 'think-maker', '', '', '2016-05-23 03:48:40', '2016-05-23 03:48:40', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=533', 0, 'product', '', 0),
