(547, 1, '2016-05-21 06:48:57', '2016-05-21 06:48:57', 'Years of research on structured light technology and our specialists'' experience have resulted in the high quality of 3d models provided by our RangeVision 3D scanner.\r\n\r\nRangeVision 3D scanner ensures excellent performance at the price much lower than of systems with comparable characteristics\r\n\r\nFlexibility of RangeVision 3D scanner enables you to receive scans with high resolution of small (less than 5 cm) and large (more than 1 m) real world objects and apply it in a wide range of contexts.', 'RANGEVISION', 'Years of research on structured light technology and our specialists'' experience have resulted in the high quality of 3d models provided by our RangeVision 3D scanner.\r\n\r\nRangeVision 3D scanner ensures excellent performance at the price much lower than of systems with comparable characteristics', 'publish', 'open', 'closed', '', 'rangevision', '', '', '2016-06-23 03:59:03', '2016-06-23 03:59:03', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=547', 0, 'product', '', 0),
