(549, 1, '2016-05-21 06:50:31', '2016-05-21 06:50:31', 'The compact snap-on design of iSense instantly transforms your iPhone or iPad into a 3D scanner, giving you the freedom to scan spontaneously wherever you are. Take it with you and allow your physical world to spark your creativity.\r\n\r\nPhysical to digital, and back again. Fully integrated with your Cube 3D printer, iSense allows you to upload scans directly for 3D printing, either at home or through cloud printing.\r\n\r\nDiscover the power of mobile 3D scanning on your iPhone or iPad with the iSense. Its integrated design makes it easy to capture every dimension of your favorite moments on your iPad or iPhone. Scan your family and friends, everyday events and adventures, all on your iPad or iPhone, all in 3D.', 'ISENSE 3D', 'The compact snap-on design of iSense instantly transforms your iPhone or iPad into a 3D scanner, giving you the freedom to scan spontaneously wherever you are. Take it with you and allow your physical world to spark your creativity.', 'publish', 'open', 'closed', '', 'isense-3d', '', '', '2016-06-23 03:54:01', '2016-06-23 03:54:01', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=549', 0, 'product', '', 0),
