(553, 1, '2016-05-21 06:55:43', '2016-05-21 06:55:43', '<div class="product__title">\r\n<h3>Stampante multifunzione HP DeskJet 2130 All-in-One</h3>\r\n</div>\r\n<div class="product__description">\r\n<div class="product-description">Semplificate la stampa, la scansione e la copia quotidiana con un dispositivo multifunzione HP DeskJet subito pronto all''uso.. Risparmiate con le cartucce ad al...</div>\r\n</div>\r\n<div class="product__specs">\r\n<ul>\r\n 	<li>Stampa, copia, scansione</li>\r\n 	<li>A4; B5; A6; Busta DL</li>\r\n 	<li>1 USB Hi-Speed 2.0</li>\r\n 	<li>Fino a 1.000 pagine</li>\r\n 	<li>1 anno di garanzia hardware limitata; assistenza Web 24 ore, 7 giorni alla settimana</li>\r\n</ul>\r\n</div>', 'STANPANTE', 'Semplificate la stampa, la scansione e la copia quotidiana con un dispositivo multifunzione HP DeskJet subito pronto all''uso.. Risparmiate con le cartucce ad al...', 'publish', 'open', 'closed', '', 'stanpante', '', '', '2016-06-23 03:45:29', '2016-06-23 03:45:29', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=553', 0, 'product', '', 0),
