(555, 1, '2016-05-21 06:57:04', '2016-05-21 06:57:04', '<p class="p3 ">HD Handycam® camcorder holds steady whenever you shoot, with stabilization and autofocus (AF) so smooth and sensitive that your movies will look smarter in every sense.</p>\r\n\r\n<div class="linkgroup">\r\n\r\n<b>Handycam</b> is a Sony brand used to market its camcorder range. It was launched in 1985 as the name of the first Video8 camcorder, replacing Sony''s previous line of Betamax-based models, and the name was intended to emphasize the "handy" palm size nature of the camera, made possible by the new miniaturized tape format. This was in marked contrast to the larger, shoulder mounted cameras available before the creation of Video8, and competing smaller formats such as VHS-C.\r\n\r\nSony has continued to produce Handycams in a variety of guises ever since, developing the Video8 format to produce Hi8 (equivalent to S-VHS quality) and later Digital8, using the same basic format to record digital video. The Handycam label continues to be applied as recording formats evolve.\r\n\r\n</div>', '3D XYZ', '<b>Handycam</b> is a Sony brand used to market its camcorder range. It was launched in 1985 as the name of the first Video8 camcorder, replacing Sony''s previous line of Betamax-based models, and the name was intended to emphasize the "handy" palm size nature of the camera, made possible by the new miniaturized tape format. This was in marked contrast to the larger, shoulder mounted cameras available before the creation of Video8, and competing smaller formats such as VHS-C.', 'publish', 'open', 'closed', '', '3d-xyz', '', '', '2016-06-23 03:56:47', '2016-06-23 03:56:47', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?post_type=product&#038;p=555', 0, 'product', '', 0),
