(573, 1, '2016-05-23 02:17:10', '2016-05-23 02:17:10', '<b>Rubik''s Cube</b> is a 3-D combination puzzle invented in 1974by Hungarian sculptor and professor of architecture Ernő Rubik. Originally called the <b>Magic Cube</b>, the puzzle was licensed by Rubik to be sold by Ideal Toy Corp. in 1980 via businessman Tibor Laczi and Seven Towns founder Tom Kremer,and won the German Game of the Year special award for Best Puzzle that year. As of January 2009, 350 million cubes had been sold worldwide making it the world''s top-selling puzzle game.<span style="font-size: 13.3333px; line-height: 20px;">I</span>t is widely considered to be the world''s best-selling toy.<sup id="cite_ref-10" class="reference"></sup>In a classic Rubik''s Cube, each of the six faces is covered by nine stickers, each of one of six solid colours: white, red, blue, orange, green, and yellow. In currently sold models, white is opposite yellow, blue is opposite green, and orange is opposite red, and the red, white and blue are arranged in that order in a clockwise arrangement.On early cubes, the position of the colours varied from cube to cube.<sup id="cite_ref-12" class="reference"><a href="https://en.wikipedia.org/wiki/Rubik%27s_Cube#cite_note-12">[12]</a></sup> An internal pivot mechanism enables each face to turn independently, thus mixing up the colours. For the puzzle to be solved, each face must be returned to have only one colour. Similar puzzles have now been produced with various numbers of sides, dimensions, and stickers, not all of them by Rubik.', 'RUBIK’S CUBE', '', 'inherit', 'closed', 'closed', '', '523-autosave-v1', '', '', '2016-05-23 02:17:10', '2016-05-23 02:17:10', '', 523, 'http://demo.cms-theme.net/wordpress/3dprinting/523-autosave-v1/', 0, 'revision', '', 0),
(574, 1, '2016-05-23 02:35:41', '2016-05-23 02:35:41', '<div id="product_description" class="col-1-1 alpha omega with-border" data-section="product-overview">\n<div class="section">\n<div id="product-description-traditional">\n<div class="main_description alpha omega col-6-10">\n<p class="normal">The educational and useful MakerBot Replicator Mini Compact 3D Printer provides easy, affordable and portable 3D printing. Transform a small desk in your home or classroom into an exciting learning center. Educate students how to think, imagine, create, and print in 3D, while preparing them for the jobs of the future. Create opportunities for children to bond with parents, siblings, classmates, and teachers. Choose from over 465,000 free, predesigned, and ready-to-print educational, entertaining, and useful 3D models on MakerBot Thingiverse. Itâ€™s portable, so take it where you need it.</p>\n\n<ul class="bulletList">\n 	<li>Easy, affordable and portable 3D printing</li>\n 	<li>Enjoy simple convenience with everything you need to get started</li>\n 	<li>Start printing right away with virtually no learning curve</li>\n 	<li>Transforms a small desk in your home or classroom into an exciting learning center</li>\n 	<li>Educate students how to think, imagine, create, craft and print in 3D, while preparing them for the jobs of the future</li>\n 	<li>Create opportunities for students to bond with parents, siblings, classmates, and teachers</li>\n 	<li>Fifth Generation technology defines the new standard for ease of use</li>\n 	<li>Create and print models directly from your tablet or smartphone using MakerBot PrintShop</li>\n 	<li>Portable â€“ take it where you need it</li>\n 	<li>Access the MakerBot 3D Ecosystem, a growing, synergetic ecosystem of products, materials, software, accessories, services, and content that integrate seamlessly with each other to provide a satisfying MakerBot experience</li>\n</ul>\n</div>\n<div id="moreinfo_wrapper" class="col-4-10 alpha omega" data-component="info-and-guides">\n<div id="more-info">\n<h3 class="page-title">Info &amp; Guides</h3>\n<ul>\n 	<li><span class="btn-icon"><i class="icon-view-pdf"></i>Installation Guide</span></li>\n</ul>\n<p class="download_message">You will need Adobe® Acrobat® Reader to view PDF documents. <a href="http://www.adobe.com/products/acrobat/readstep2.html" target="_blank" data-target="Download"> Download</a> a free copy from the Adobe Web sit</p>\n\n</div>\n</div>\n</div>\n</div>\n</div>\n<div id="irgContainer" class="col-1-1 alpha omega with-border">\n<div id="ACCESSORIES" class="row IRGsectionWrapper  in alpha omega">\n<div class="irg_bg_graybox"></div>\n</div>\n</div>', 'MAKER BOT MINI', '', 'inherit', 'closed', 'closed', '', '331-autosave-v1', '', '', '2016-05-23 02:35:41', '2016-05-23 02:35:41', '', 331, 'http://demo.cms-theme.net/wordpress/3dprinting/331-autosave-v1/', 0, 'revision', '', 0),
(575, 1, '2016-05-23 03:04:20', '2016-05-23 03:04:20', 'Through a partnership between Dubai and Winsun Global, a Chinese 3D printing technology company, Dubai is set to build the world’s first 3D-printed office building. Winsun Global will print the office layer by layer using a 3d printer that measures 20 ft in height, the same 3d printer which they used to 3D print a 6 story apartment building in Shanghai last year.<del></del>\r\n\r\nThe 3D printed office building will cover over 2,000 sq feet, and will only take weeks to complete its construction. The office building will stand as a temporary headquarter to Dubai’s Museum of the Future, which was launched earlier this year.', 'Dubai to Construct the World’s First 3D Printed Office Building', '', 'publish', 'open', 'open', '', 'dubai-to-construct-the-worlds-first-3d-printed-office-building-2', '', '', '2016-05-23 03:04:20', '2016-05-23 03:04:20', '', 0, 'http://demo.cms-theme.net/wordpress/3dprinting/?p=575', 0, 'post', '', 0),
