(578, 1, '2016-05-23 03:19:47', '2016-05-23 03:19:47', '<p class="p3 ">HD Handycam® camcorder holds steady whenever you shoot, with stabilization and autofocus (AF) so smooth and sensitive that your movies will look smarter in every sense.</p>\n\n<div class="linkgroup">\n\n<b>Handycam</b> is a <a title="Sony" href="https://en.wikipedia.org/wiki/Sony">Sony</a> brand used to market its <a title="Camcorder" href="https://en.wikipedia.org/wiki/Camcorder">camcorder</a> range. It was launched in 1985 as the name of the first <a class="mw-redirect" title="Video8" href="https://en.wikipedia.org/wiki/Video8">Video8</a> camcorder, replacing Sony''s previous line of <a title="Betamax" href="https://en.wikipedia.org/wiki/Betamax">Betamax</a>-based models, and the name was intended to emphasize the "handy" palm size nature of the camera, made possible by the new miniaturized tape format. This was in marked contrast to the larger, shoulder mounted cameras available before the creation of Video8, and competing smaller formats such as <a title="VHS-C" href="https://en.wikipedia.org/wiki/VHS-C">VHS-C</a>.\n\nSony has continued to produce Handycams <sup id="cite_ref-1" class="reference"><a href="https://en.wikipedia.org/wiki/Handycam#cite_note-1">[1]</a></sup> in a variety of guises ever since, developing the Video8 format to produce <a class="mw-redirect" title="Hi8" href="https://en.wikipedia.org/wiki/Hi8">Hi8</a> (equivalent to S-VHS quality) and later Digital8, using the same basic format to record <a title="Digital video" href="https://en.wikipedia.org/wiki/Digital_video">digital video</a>. The Handycam label continues to be applied as recording formats evolve.\n\n</div>', 'HANDYCAN', '', 'inherit', 'closed', 'closed', '', '551-autosave-v1', '', '', '2016-05-23 03:19:47', '2016-05-23 03:19:47', '', 551, 'http://demo.cms-theme.net/wordpress/3dprinting/551-autosave-v1/', 0, 'revision', '', 0),
(579, 1, '2016-05-23 03:25:48', '2016-05-23 03:25:48', 'The compact snap-on design of iSense instantly transforms your iPhone or iPad into a 3D scanner, giving you the freedom to scan spontaneously wherever you are. Take it with you and allow your physical world to spark your creativity.\n\nPhysical to digital, and back again. Fully integrated with your Cube 3D printer, iSense allows you to upload scans directly for 3D printing, either at home or through cloud printing.\n\nDiscover the power of mobile 3D scanning on your iPhone or iPad with the iSense. Its integrated design makes it easy to capture every dimension of your favorite moments on your iPad or iPhone. Scan your family and friends, everyday events and adventures, all on your iPad or iPhone, all in 3D.', 'ISENSE 3D', '<p>The compact snap-on design of iSense instantly transforms your iPhone or iPad into a 3D scanner, giving you the freedom to scan spontaneously wherever you are. Take it with you and allow your physical world to spark your creativity.</p>', 'inherit', 'closed', 'closed', '', '549-autosave-v1', '', '', '2016-05-23 03:25:48', '2016-05-23 03:25:48', '', 549, 'http://demo.cms-theme.net/wordpress/3dprinting/549-autosave-v1/', 0, 'revision', '', 0),
(580, 1, '2016-05-23 03:27:13', '2016-05-23 03:27:13', 'Years of research on structured light technology and our specialists'' experience have resulted in the high quality of 3d models provided by our RangeVision 3D scanner.\n\nRangeVision 3D scanner ensures excellent performance at the price much lower than of systems with comparable characteristics\n\nFlexibility of RangeVision 3D scanner enables you to receive scans with high resolution of small (less than 5 cm) and large (more than 1 m) real world objects and apply it in a wide range of contexts.', 'RANGEVISION', '', 'inherit', 'closed', 'closed', '', '547-autosave-v1', '', '', '2016-05-23 03:27:13', '2016-05-23 03:27:13', '', 547, 'http://demo.cms-theme.net/wordpress/3dprinting/547-autosave-v1/', 0, 'revision', '', 0),
(582, 1, '2016-05-23 03:36:23', '2016-05-23 03:36:23', 'J-CAD Inc. has created a 3D printed Ashtray which automatically extinguishes and preserves unfinished cigars.The product was developed by a cigar enthusiast named Ray, who contacted J-CAD Inc., a company that specializes in 3D CAD design and drafting to create a simple design for the automatic cigar ashtray.With the help of J-CAD, Ray completed the prototype of a unique creation, which activates a set of blades inside to cut off oxygen supply that fuels the burn, and preserve left over cigar.\n<blockquote><em class="font-second">"Sensibus oportere signiferumque id mea. At usu lucilius phaedrum, vix oratio epicurei ne. Eripuit conceptam sea cu, ius minim delectus euripidis cu. Probo nonumy gubergren id nec. In est probo ridens, his laoreet euripidis et."</em></blockquote>\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\n\n<img class="aligncenter wp-image-41 size-full" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting-history.jpg" alt="3dprinting-history" width="913" height="447" />\n\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\n\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', '3D Printed Ashtray Preserves Cigars Automatically', '', 'inherit', 'closed', 'closed', '', '262-autosave-v1', '', '', '2016-05-23 03:36:23', '2016-05-23 03:36:23', '', 262, 'http://demo.cms-theme.net/wordpress/3dprinting/262-autosave-v1/', 0, 'revision', '', 0),
(583, 1, '2016-05-23 03:47:22', '2016-05-23 03:47:22', 'Tinkerplay is based on the Modio app which Autodesk acquired last year. The app allowed for simple, intuitive and entertaining construction of models which were almost immediately available for 3D printing without the need for additional rafts or support material.', 'THINK MAKER', '', 'inherit', 'closed', 'closed', '', '533-autosave-v1', '', '', '2016-05-23 03:47:22', '2016-05-23 03:47:22', '', 533, 'http://demo.cms-theme.net/wordpress/3dprinting/533-autosave-v1/', 0, 'revision', '', 0),
(584, 1, '2016-05-23 04:16:00', '2016-05-23 04:16:00', '<blockquote><em>Recently Natural Machines made the news with more detailed specifications about their long-expected <a title="Healthy food printer" href="http://3dprinting.com/3dprinters/foodini290314/" target="_blank">healthy food printer</a>, which will be released later on this year. The news was remarkable, as food printing today mainly refers to producing less healthy products, such as <a title="Chocolates" href="http://3dprinting.com/news/3d-print-face-chocolate/" target="_blank">chocolates</a>, <a title="3D printed sweets" href="http://3dprinting.com/news/new-3d-printer-can-print-sweets/" target="_blank">sweets</a> and<a title="Space pizza" href="http://3dprinting.com/materials/edibles-food/nasa-eating-3d-printed-pizza-space/" target="_blank">space pizzas</a>. Now, only two weeks later, another party is trying the healthier side of food printing. And not just some party, because it’s the European Union, working on a food printer to prepare personalized meals for the elder</em>\n\n&nbsp;</blockquote>\nThis project regards to an older target group, as in 2025 one in five citizens in the EU will be 65-years-old and over. The general problem with this group is that a lot of them will undergo difficulties swallowing their food. This condition is called dysphagia and studies show that today 15 to 25 percent of all people over 50 years suffer from such a condition. The problem however is that the same group has a higher risk of getting sick in some way, which often requires specialized diets. If someone can’t swallow properly, then that surely is a problem.\n\nOf course there are pureed foods to provide for nutritious meals, without having to face the difficulties of swallowing larger pieces. However, as the team behind the EU project points out, such pureed meals can be unappealing and unappetizing to the elderly, leading to a reduced quality of life. Moreover, an <a title="NCBI" href="http://www.ncbi.nlm.nih.gov/pubmed/11956839?dopt=Abstract" target="_blank">NCBI study</a> shows that one-third of the people with dysphagia even avoid eating with others, because of their disease.', 'EU Works on Food Printer to Create Personalized Meals for the Elderly', '', 'inherit', 'closed', 'closed', '', '42-autosave-v1', '', '', '2016-05-23 04:16:00', '2016-05-23 04:16:00', '', 42, 'http://demo.cms-theme.net/wordpress/3dprinting/42-autosave-v1/', 0, 'revision', '', 0),
(585, 1, '2016-05-23 04:00:30', '2016-05-23 04:00:30', '[gallery columns="1" size="full" ids="44,45"]\nWe automatically tend to link the concept of ‘drones’ with controversial war stories, but a Belgian team proves that this technique could also be used differently. Meet <a title="Airbutlr" href="http://www.airbutlr.com/" target="_blank">AirButlr</a>, a 3D printed drone that is expected to be able to clean your house. A team is still working on the machine, but it will one day be capable of detecting dirt and using several cleaning materials to clean up the dirty places in your house. In other words: in the 21st century we don’t need the work of humans to make our cleaning work happen.\n\n<img class="aligncenter wp-image-41 size-full" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting-history.jpg" alt="3dprinting-history" width="913" height="447" />\n\nThe machine will detect dirt, because it works with advanced sensors, batteries and motors as well as it will be using algorithms and high-level detection to make it happen. It will also be possible to operate the AirButlr yourself,  by using a smartphone application. This will enable users to command the AirButlr, after which the machine will clean up the place with the right cleaning materials. Interesting development, we’re curious whether this will become a big hit on Kickstarter or not. It could easily become something huge. Well, watch this video below to see how it will work', 'This 3D Printed Drone Can Clean Your House', '', 'inherit', 'closed', 'closed', '', '43-autosave-v1', '', '', '2016-05-23 04:00:30', '2016-05-23 04:00:30', '', 43, 'http://demo.cms-theme.net/wordpress/3dprinting/43-autosave-v1/', 0, 'revision', '', 0),
(587, 1, '2016-06-23 02:42:59', '2016-06-23 02:42:59', '3D Printing is an online 3D printing service for all people with an eye for design and a head full of ideas. Turn your ideas into 3D printed reality.\n\n<img class="alignnone wp-image-589" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/hero_artwork-300x138.jpg" alt="hero_artwork" width="981" height="452" />\n<h4>Dream it. Design it. Print it in 3D.</h4>\nYou already create cool designs in Photoshop. Now it’s time to turn those designs into real-world objects. Use the Photoshop tools you already know to design, color, and add texture to 3D designs—for design prototypes, fine art, jewelry, ornaments, and more—and then print them on your own 3D printer or via a 3D printing service.\n\nMany 3D printer profiles ship with Photoshop CC, and we make the latest ones available to you online. Simply download and install the profiles you want, and they’ll be available from within Photoshop CC the next time you launch the app.\n\n[caption id="attachment_591" align="alignnone" width="831"]<img class=" wp-image-591" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/ORDbot_quantum-1-300x188.jpg" alt="SONY DSC" width="831" height="521" /> SONY DSC[/caption]\n\n&nbsp;', '3D Printing', '', 'inherit', 'closed', 'closed', '', '216-autosave-v1', '', '', '2016-06-23 02:42:59', '2016-06-23 02:42:59', '', 216, 'http://demo.cms-theme.net/wordpress/3dprinting/216-autosave-v1/', 0, 'revision', '', 0),
