(592, 1, '2016-05-23 04:42:33', '2016-05-23 04:42:33', 'If you''re not that much of a designer, you''re able to use the creation corner where you can use your 3D modeling service to hire a professional designer to design your.\n\n<img class="alignnone wp-image-593" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/34691EE500000578-3602190-image-a-26_1463826066911-300x175.jpg" alt="34691EE500000578-3602190-image-a-26_1463826066911" width="819" height="478" />\n<p class="mol-para-with-font">Consisting of Dr Matheus Rabello, Dr Paulo Miamoto, Dr Roberto Fecchio, Cicero Moraes, Dr Sergio Camargo and Dr Rodrigo Rabello the experts volunteer their services and time.</p>\n<p class="mol-para-with-font">Based in Sao Paulo, the team have reconstructed artificial beaks for three toucans, a parrot, and a goose; designed the first ever titanium prosthetic pecker for a Macaw and built a brand new plastic-based replacement hull for a traumatised tortoise.</p>\n<p class="mol-para-with-font">Dr Fecchio said: ''We first came together as friends because of our common love of science and our love for animals.</p>\n<p class="mol-para-with-font">''We soon realised we could do some extraordinary work using cutting-edge technology to push back the boundaries of life-saving care for mutilated animals by giving them customised prostheses.''</p>\n<img class="size-medium wp-image-595 aligncenter" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/34691EC100000578-3602190-image-a-24_1463826052716-1-300x237.jpg" alt="34691EC100000578-3602190-image-a-24_1463826052716" width="300" height="237" />\n<p class="mol-para-with-font">Dr Matheus Rabello, who worked on the parrot, said: ''We were worried the renewable plastic used to make the prosthetics would not withstand the demands of a parrot''s beak, which is used to crack nuts and to climb.''</p>\n<p class="mol-para-with-font">However, the prosthesis proved to be a super-strong substitute.</p>\n<p class="mol-para-with-font">Another touchstone triumph with the first prosthetic beak built for a goose. The poor gander named Vitoria, had lost most of its top and bottom choppers and would have died without urgent corrective surgery.</p>\n<p class="mol-para-with-font">They also produced the world''s first titanium beak for Gigi, an abandoned Macaw.</p>\n<p class="mol-para-with-font">The breakthrough bionic 3D metal beak was attached to the Macaw''s severely damaged beak with bone cement and secured with eight colourful orthopaedic screws.</p>', '3D DESIGN', '', 'inherit', 'closed', 'closed', '', '220-autosave-v1', '', '', '2016-05-23 04:42:33', '2016-05-23 04:42:33', '', 220, 'http://demo.cms-theme.net/wordpress/3dprinting/220-autosave-v1/', 0, 'revision', '', 0),
