(596, 1, '2016-05-23 05:04:58', '2016-05-23 05:04:58', '<p class="p1">Using a unique apprenticeship program to help train underserved communities learn advanced manufacturing skills such as 3D printing, we have just been given the opportunity to expand their approach even further. We have just been awarded with a whopping $4.9 million grant from the U.S. Department of Labor to help expand their apprenticeship model. We have already trained over 3,000 workers over the past five years, operating out of their home base</p>\n<img class="alignnone  wp-image-597" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/education-300x200.jpeg" alt="education" width="836" height="557" />\n\n<em>“This award recognizes a unique approach to apprenticeship building in West Virginia – praised by the DOL – that has the potential to be replicated across the nation and to address the growing skills gap in manufacturing,”</em> said Charlotte Weber, Director and CEO.  By supporting manufacturing technology training, we have been encouraging job creation, economic development, and innovation across West Virginia and, now, with help from this new grant, across the United States, too.\n\n<img class="aligncenter size-full wp-image-218" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/image-services1.jpg" alt="image-services1" width="870" height="400" />', 'EDUCATION', '', 'inherit', 'closed', 'closed', '', '221-autosave-v1', '', '', '2016-05-23 05:04:58', '2016-05-23 05:04:58', '', 221, 'http://demo.cms-theme.net/wordpress/3dprinting/221-autosave-v1/', 0, 'revision', '', 0),
(597, 1, '2016-05-23 05:04:08', '2016-05-23 05:04:08', '', 'education', '', 'inherit', 'open', 'closed', '', 'education-2', '', '', '2016-05-23 05:04:08', '2016-05-23 05:04:08', '', 221, 'http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/education.jpeg', 0, 'attachment', 'image/jpeg', 0),
(598, 1, '2016-05-23 05:04:54', '2016-05-23 05:04:54', '', '3dprinting', '', 'inherit', 'open', 'closed', '', '3dprinting', '', '', '2016-05-23 05:04:54', '2016-05-23 05:04:54', '', 221, 'http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/3dprinting.jpg', 0, 'attachment', 'image/jpeg', 0),
(599, 1, '2016-05-23 05:12:46', '2016-05-23 05:12:46', 'lf you''re not that much of a designer, we offer apps &amp; support about technical And you can design your own products, with the precision of a professional designer.\n\n<img class="alignnone  wp-image-601" src="http://demo.cms-theme.net/wordpress/3dprinting/wp-content/uploads/2016/05/News-rk-300x188.jpg" alt="News rk" width="793" height="497" />\n\nRight now, the team is working on creating a prototype for the insole by taking 3D scans of Marco’s feet and other patients with feet problems. The team is also working on getting more doctors on board with the project.\n\n“We’re trying to see if insurance could cover the appointment because that would be huge. Realistically, a lot of people who have foot problems are older, and if it could get covered by insurance, it would save a lot of money,” Marco said.When creating Digifeet, one of the biggest challenges the team faced was creating a unique product. Other companies do make insoles, but 3D scanning is the ultimate way to make custom insoles, Marco said.\n\n&nbsp;', 'IDEA & SOLUTION', '', 'inherit', 'closed', 'closed', '', '227-autosave-v1', '', '', '2016-05-23 05:12:46', '2016-05-23 05:12:46', '', 227, 'http://demo.cms-theme.net/wordpress/3dprinting/227-autosave-v1/', 0, 'revision', '', 0),
